import React from "react";
import {Link} from 'react-router-dom'


export default function Card({id,name,image,types}){
    console.log(types)
    return(
        <div>
            <Link to={`/home/${id}`}>
            <h3>{name}</h3>
            <img src={image} alt="imagen no encontrada" width="250px"/>
            </Link>
            {types.map((el,i)=>{
                if(typeof el==='string'){
                    <p key={i}>{el}</p>
                }
                else{
                    <p key={i}>{el.name}</p>
                }
            })}
        </div>
    )
}
